import React, { useState, useEffect } from 'react';

function App() {
  const [message, setMessage] = useState('Cargando...');

  useEffect(() => {
    setTimeout(() => {
      setMessage('¡Hola, Mundo!');
    }, 2000); // Cambia el mensaje después de 2 segundos
  }, []);

  return (
    <div className="App">
      <h1>{message}</h1>
    </div>
  );
}

export default App;
